import { Route, Router, Routes } from "react-router-dom";
import LoginForm from "./components/loginform";
import SignForm from "./components/signup";

function App() {
  return (
    <div className="page">
    <Router>
        <Routes>
          <Route path="/" element={<LoginForm />}/>
          <Route path="/signup" element={<SignForm/>}/>
        </Routes>
      </Router>

    </div>
  );
}

export default App;
